// Incoming data from webhook
const input = $json;

// Extract only relevant fields and clean data
const cleanData = {
  ticketId: `T-${Date.now()}`,                     
  action: input.body?.action || null,
  name: input.body?.name || null,
  email: input.body?.email || null,
  issueType: input.body?.issueType || null,
  description: input.body?.description || null,
  timestamp: input.body?.timestamp || new Date().toISOString(),

  // Additional useful metadata
  status: "Open",
  priority: input.body?.issueType === "unauthorized-data-use" ? "High" : "Normal",
  source: input.headers?.origin || "unknown"
};

// Return clean formatted output for next nodes
return [{ json: cleanData }];

