=Generate a formal acknowledgement email for the data consent complaint based on the following details:

Ticket ID: {{$json.ticketId}}
User Name: {{$json.name}}
User Email: {{$json.email}}
Issue Type: {{$json.issueType}}
Description: {{$json.description}}
Reported At: {{$json.timestamp}}
Priority Level: {{$json.priority}}

The email must:
- Start with a greeting using the user's name
- Acknowledge receipt of their concern
- Mention the ticket ID clearly
- Summarize their reported issue in a respectful way
- Inform that the privacy/compliance team will review and respond
- Provide an estimated response window (48‚Äì72 hours)
- Offer them an option to share any additional information
- Close professionally

Now generate the final email.

