const raw = $json.output;

// Normalize line breaks
const text = raw.replace(/\r\n/g, "\n").trim();

// Extract subject (everything until first newline)
const firstLineBreak = text.indexOf("\n");
let subject = "";
let message = "";

// If we found a line break, split
if (firstLineBreak !== -1) {
  subject = text.substring(0, firstLineBreak).replace("Subject:", "").trim();
  message = text.substring(firstLineBreak).trim();
} else {
  // fallback if no newline found
  subject = text.replace("Subject:", "").trim();
  message = "";
}

// Return clean JSON
return [{
  json: {
    subject,
    message
  }
}];

